import React from 'react';
import './style.css';

import { VictoryBar, VictoryChart, VictoryTheme, VictoryAxis, VictoryLabel } from 'victory';

const languageData = [
  {x: "SQL", y: 2},
  {x: "C++", y: 3},
  {x: "JS", y: 3},
  {x: "Python", y: 4},
  {x: "Java", y: 5},
];

const frameworkData = [
  {x: "Node", y: 2},
  {x: "Express.js", y: 3},
  {x: "React.js", y: 4},
  {x: "Django", y: 5}
]

class Skills extends React.Component {
  render() {
    return (
      <div>
      <h1 id="skills" class='body-section-header'>Skills</h1>
      <div className="chart-wrapper">
      <VictoryChart
        theme={VictoryTheme.material}
        animate={{
          duration: 2000,
          easing: "bounce"
        }}
        height={200}
        domainPadding={{ x: 10 }}
        >

        <VictoryLabel text="Programming Language Proficiency" x={225} y={30} textAnchor="middle"/>

        <VictoryAxis

        />
        <VictoryAxis
          dependentAxis
          tickFormat={[1,2,3,4,5]}
        />
        <VictoryBar horizontal
          data={languageData}
          barRatio={0.8}
          labels={({ datum }) => datum.y}
          style={{ labels: { fill: "white" } }}
          labelComponent={<VictoryLabel dx={-20}/>}

        />
      </VictoryChart>
      </div>
      <div className="chart-wrapper">
      <VictoryChart
        theme={VictoryTheme.material}
        animate={{
          duration: 2000,
          easing: "bounce"
        }}
        height={200}
        domainPadding={{ x: 10 }}
        >

        <VictoryLabel text="Framework Proficiency" x={225} y={30} textAnchor="middle"/>

        <VictoryAxis

          padding={{ top: 1, bottom: 1, left: 100 }}
        />
        <VictoryAxis
          dependentAxis
          tickFormat={[1,2,3,4,5]}
        />
        <VictoryBar horizontal
          data={frameworkData}
          barRatio={0.8}
          labels={({ datum }) => datum.y}
          style={{ labels: { fill: "white" } }}
          labelComponent={<VictoryLabel dx={-20}/>}

        />
      </VictoryChart>
      </div>
      </div>
    )

  }
}

export default Skills;
